import React from "react";
import "./NavBar.css"
import {withRoute} from "react-router";

function NavBar() {
    return (
        <nav className="navbar">
            <div className="button-list">
                <NavBarButton name="Home" onClick={() => this.props.history.push("/Home")}/>
                <NavBarButton name="Community"/>
                <NavBarButton name="My wardrobe"/>
                <NavBarButton name="My profile"/>
                <NavBarButton name="Sign in"/>
            </div>
        </nav>
    )
}

function NavBarButton(props) {
    return (
        <button className='navbar-button'
                onClick={props.onClick}
        >
            {props.name}
        </button>
    )
}

export default withRoute(NavBar);
